/// description : "{\"en\": \"\", \"oz\": \"<p>Ombudsmanga berilgan murojaatda arz qiluvchining familiyasi (ismi, otasining\\nismi), uning yashash joyi to‘g‘risidagi ma’lumotlar, shikoyat nodavlat notijorat\\ntashkiloti tomonidan berilgan taqdirda esa, uning to‘liq nomi, joylashgan yeri\\n(pochta manzili) to‘g‘risidagi ma’lumotlar ko‘rsatilgan bo‘lishi kerak.\\nMurojaatda qarorlari, harakatlari yoki harakatsizligi ustidan shikoyat qilinayotgan\\ntashkilotning nomi, mansabdor shaxsning familiyasi (ismi, otasining ismi)\\nko‘rsatiladi, arz qiluvchining fikricha, uning huquqlarini buzgan qarorlarning,\\nharakatlarning yoki harakatsizlikning mohiyati bayon etiladi.\\nMurojaatga u bo‘yicha ilgari qabul qilingan mavjud qarorlar yoki ularning\\nko‘chirma nusxalari, shuningdek uni ko‘rib chiqish uchun zarur bo‘lgan boshqa\\nhujjatlar ilova qilinishi mumkin, mazkur hujjatlar qaytarilmaydi, murojaat etuvchi\\nularni qaytarish haqida yozma ariza bergan hollar bundan mustasno. Ko‘rsatib\\no‘tilgan hujjatlar murojaat taalluqliligi bo‘yicha boshqa davlat organiga, tashkilotga\\nyoki ularning mansabdor shaxsiga yuborilganda murojaatga ilova qilinishi kerak.<p/><p style=\\\"color: #1a202c;font-size: 16px;font-weight: 700\\\">Ombudsman anonim murojaatlarni ko‘rib chiqmaydi.</p><p style=\\\"font-weight: 600;color: #1a202c;font-size: 16px;\\\">Ma’lumot uchun:</p><p>anonim murojaat – jismoniy shaxsning familiyasi (ismi, otasining\\nismi), uning yashash joyi to‘g‘risidagi ma’lumotlar yoki yuridik shaxsning to‘liq\\nnomi, uning joylashgan eri (pochta manzili) to‘g‘risidagi ma’lumotlar\\nko‘rsatilmagan yoxud ular haqida yolg‘on ma’lumotlar ko‘rsatilgan murojaat,\\nshuningdek uni identifikatsiya qilish imkoniyatini bermaydigan elektron murojaat\\nyoxud imzo bilan tasdiqlanmagan yozma murojaat.\\nJismoniy va yuridik shaxslar murojaatni mustaqil ravishda berishga, shuningdek o‘z\\nvakili orqali murojaat qilishga haqli.\\nJismoniy va yuridik shaxslarning vakillari orqali berilgan murojaatlar, ularning\\nvakolatini tasdiqlovchi hujjatlar mavjud bo‘lmagan taqdirda ko‘rmasdan qoldiriladi\\nhamda bu haqida tegishli tartibda murojaatchi xabardor qilinadi</p><p style=\\\"font-size: 16px;font-weight: 700;color: #1a202c\\\">Ombudsman</p><p>O‘zbekiston Respublikasi fuqarolarining hamda O‘zbekiston\\nRespublikasi hududidagi chet el fuqarolari va fuqaroligi bo‘lmagan shaxslarning o‘z\\nhuquqlari, erkinliklari hamda qonuniy manfaatlarini buzayotgan tashkilotlar\\nyoki mansabdor shaxslarning harakatlari yoxud harakatsizligi ustidan bergan\\nshikoyatlarini ko‘rib chiqadi.</p><span style=\\\"text-underline: #1a202c\\\">Ombudsman fuqarolar o‘rtasida vujudga keladigan o‘zaro huquqiy munosabatlar\\nbo‘yicha murojaatlarni ko‘rib chiqmaydi.</span><p style=\\\"color: #1a202c;font-size: 15px;font-weight: 700\\\">Ombudsman sudning vakolat doirasiga kiradigan masalalarni ko‘rib\\nchiqmaydi.</p><p style=\\\"color: #1a202c;font-size: 16px;font-weight: 700\\\">Ombudsman</p><p>parlament nazorati subyekti sifatida tezkor-qidiruv faoliyatini\\namalga oshiruvchi organlarning, surishtiruv va tergov organlarining, sudlarning\\nish yurituvidagi muayyan ishlar va materiallarni, shuningdek ijro ishi yuritish hamda\\nnotarial ish yuritishning muayyan materiallarini ko‘rib chiqish bilan bog‘liq\\nfaoliyati bilan bog‘liq masalalarni ko‘rib chiqmaydi.</p><p>Ombudsman arz qiluvchiga o‘z huquqlari, erkinliklari va qonuniy manfaatlari\\nbuzilganligi ma’lum bo‘lib qolgan paytdan e’tiboran yoki arz qiluvchi, agar u\\nhuquqlari, erkinliklari va qonuniy manfaatlarini himoya qilishning boshqa\\nvositalaridan foydalangan hamda qabul qilingan qarorlardan qanoatlanmagan\\nbo‘lsa,</p><p style=\\\"font-size: 16px;font-weight: 700;color: #1a202c\\\">o‘z shikoyati bo‘yicha qabul qilingan oxirgi qarordan xabar topgan\\npaytdan e’tiboran bir yil davomida berilgan shikoyatlarni ko‘rib chiqadi.</p>\", \"ru\": \"<p>В обращении, поданному Омбудсману, должны содержаться фамилия (имя,\\nотчество) заявителя, сведения о месте его жительства, а в случае подачи\\nжалобы негосударственной некоммерческой организацией — ее полное\\nнаименование, сведения о местонахождении (почтовом адресе).\\nВ обращении указываются наименование организации, фамилия (имя,\\nотчество) должностного лица, чьи решения, действия или бездействие\\nобжалуются, изложение существа решений, действий или бездействия,\\nнарушивших, по мнению заявителя, его права.\\nК обращению могут прилагаться имеющиеся решения, ранее принятые по\\nнему, или их копии, а также другие документы, необходимые для его\\nрассмотрения, которые не подлежат возврату, за исключением случаев\\nписьменного заявления обращающегося об их выдаче. При направлении\\nобращения по подведомственности в иной государственный орган,\\nорганизацию или должностному лицу к нему должны быть приложены\\nуказанные документы<p/><p style=\\\"color: #1a202c;font-size: 16px;font-weight: 700\\\">Омбудсманом не рассматриваются анонимные обращения.</p><p style=\\\"font-weight: 600;color: #1a202c;font-size: 16px;\\\">Для справки:</p><p>анонимное обращение — обращение, в котором не указаны фамилия\\n(имя, отчество) физического лица, сведения о месте его жительства или полное\\nнаименование юридического лица, сведения о его местонахождении (почтовом\\nадресе) либо указаны ложные сведения о них, а также электронное обращение, не\\nпозволяющее его идентифицировать, либо письменное обращение, не\\nподтвержденное подписью.\\nФизические и юридические лица имеют право подавать обращения\\nсамостоятельно и через своего представителя.\\nОбращения, поданные через представителей физических и юридических лиц\\nпри отсутствии документов, подтверждающих их полномочия оставляются без\\nрассмотрения, о чем они уведомляются в установленном законом порядке.</p><p style=\\\"font-size: 16px;font-weight: 700;color: #1a202c\\\">Омбудсман</p><p>рассматривает жалобы граждан Республики Узбекистан и\\nнаходящихся на территории Республики Узбекистан иностранных граждан и\\nлиц без гражданства на действия или бездействие организаций или\\nдолжностных лиц, нарушающих их права, свободы и законные интересы.</p><span style=\\\"text-underline: #1a202c\\\">Омбудсманом не рассматриваются обращения, предметом которых являются\\nправоотношения между гражданами</span><p style=\\\"color: #1a202c;font-size: 15px;font-weight: 700\\\">Омбудсман не рассматривает вопросы, отнесенные к компетенции суда.</p><p style=\\\"color: #1a202c;font-size: 16px;font-weight: 700\\\">Ombudsman</p><p>parlament nazorati subyekti sifatida tezkor-qidiruv faoliyatini\\namalga oshiruvchi organlarning, surishtiruv va tergov organlarining, sudlarning\\nish yurituvidagi muayyan ishlar va materiallarni, shuningdek ijro ishi yuritish hamda\\nnotarial ish yuritishning muayyan materiallarini ko‘rib chiqish bilan bog‘liq\\nfaoliyati bilan bog‘liq masalalarni ko‘rib chiqmaydi.</p><p>Ombudsman arz qiluvchiga o‘z huquqlari, erkinliklari va qonuniy manfaatlari\\nbuzilganligi ma’lum bo‘lib qolgan paytdan e’tiboran yoki arz qiluvchi, agar u\\nhuquqlari, erkinliklari va qonuniy manfaatlarini himoya qilishning boshqa\\nvositalaridan foydalangan hamda qabul qilingan qarorlardan qanoatlanmagan\\nbo‘lsa,</p><p style=\\\"font-size: 16px;font-weight: 700;color: #1a202c\\\">o‘z shikoyati bo‘yicha qabul qilingan oxirgi qarordan xabar topgan\\npaytdan e’tiboran bir yil davomida berilgan shikoyatlarni ko‘rib chiqadi.</p>\", \"uz\": \"<p>Омбудсманга берилган мурожаатда арз қилувчининг фамилияси (исми,\\nотасининг исми), унинг яшаш жойи тўғрисидаги маълумотлар, шикоят\\nнодавлат нотижорат ташкилоти томонидан берилган тақдирда эса, унинг\\nтўлиқ номи, жойлашган ери (почта манзили) тўғрисидаги маълумотлар\\nкўрсатилган бўлиши керак.\\nМурожаатда қарорлари, ҳаракатлари ёки ҳаракатсизлиги устидан шикоят\\nқилинаётган ташкилотнинг номи, мансабдор шахснинг фамилияси (исми,\\nотасининг исми) кўрсатилади, арз қилувчининг фикрича, унинг ҳуқуқларини\\nбузган қарорларнинг, ҳаракатларнинг ёки ҳаракатсизликнинг моҳияти баён\\nэтилади.\\nМурожаатга у бўйича илгари қабул қилинган мавжуд қарорлар ёки уларнинг\\nкўчирма нусхалари, шунингдек уни кўриб чиқиш учун зарур бўлган бошқа\\nҳужжатлар илова қилиниши мумкин, мазкур ҳужжатлар қайтарилмайди,\\nмурожаат этувчи уларни қайтариш ҳақида ёзма ариза берган ҳоллар бундан\\nмустасно. Кўрсатиб ўтилган ҳужжатлар мурожаат тааллуқлилиги бўйича\\nбошқа давлат органига, ташкилотга ёки уларнинг мансабдор шахсига\\nюборилганда мурожаатга илова қилиниши керак.\\n</p><p style=\\\"color: #1a202c;font-size: 16px;font-weight: 700\\\">Омбудсман аноним мурожаатларни кўриб чиқмайди.</p><p style=\\\"color: #1a202c;font-size: 16px;font-weight: 700\\\">Маълумот учун</p><p>аноним мурожаат – жисмоний шахснинг фамилияси (исми,\\nотасининг исми), унинг яшаш жойи тўғрисидаги маълумотлар ёки юридик\\nшахснинг тўлиқ номи, унинг жойлашган эри (почта манзили) тўғрисидаги\\nмаълумотлар кўрсатилмаган ёхуд улар ҳақида ёлғон маълумотлар\\nкўрсатилган мурожаат, шунингдек уни идентификация қилиш имкониятини\\nбермайдиган электрон мурожаатt ёхуд имзо билан тасдиқланмаган ёзма\\nмурожаат.\\nЖисмоний ва юридик шахслар мурожаатни мустақил равишда беришга,\\nшунингдек ўз вакили орқали мурожаат қилишга ҳақли.\\nЖисмоний ва юридик шахсларнинг вакиллари орқали берилган мурожаатлар,\\nуларнинг ваколатини тасдиқловчи ҳужжатлар мавжуд бўлмаган тақдирда\\nкўрмасдан қолдирилади ҳамда бу ҳақида тегишли тартибда мурожаатчи\\nхабардор қилинади.</p><p style=\\\"font-size: 16px;font-weight: 700;color: #1a202c\\\">Омбудсман</p><p>Ўзбекистон Республикаси фуқароларининг ҳамда Ўзбекистон\\nРеспубликаси ҳудудидаги чет эл фуқаролари ва фуқаролиги бўлмаган\\nшахсларнинг ўз ҳуқуқлари, эркинликлари ҳамда қонуний манфаатларини\\nбузаётган ташкилотлар ёки мансабдор шахсларнинг ҳаракатлари ёхуд\\nҳаракатсизлиги устидан берган шикоятларини кўриб чиқади.</p><span style=\\\"text-underline: #1a202c\\\">Омбудсман фуқаролар ўртасида вужудга келадиган ўзаро ҳуқуқий\\nмуносабатлар бўйича мурожаатларни кўриб чиқмайди.</span><p style=\\\"color: #1a202c;font-size: 15px;font-weight: 700\\\">Омбудсман суднинг ваколат доирасига кирадиган масалаларни кўриб\\nчиқмайди.</p><p style=\\\"color: #1a202c;font-size: 16px;font-weight: 700\\\">Омбудсман</p><p>парламент назорати субъекти сифатида тезкор-қидирув\\nфаолиятини амалга оширувчи органларнинг, суриштирув ва тергов\\nорганларининг, судларнинг иш юритувидаги муайян ишлар ва\\nматериалларни, шунингдек ижро иши юритиш ҳамда нотариал иш\\nюритишнинг муайян материалларини кўриб чиқиш билан боғлиқ фаолияти\\nбилан боғлиқ масалаларни кўриб чиқмайди.</p><p>OmОмбудсман арз қилувчига ўз ҳуқуқлари, эркинликлари ва қонуний\\nманфаатлари бузилганлиги маълум бўлиб қолган пайтдан эътиборан ёки арз\\nқилувчи, агар у ҳуқуқлари, эркинликлари ва қонуний манфаатларини ҳимоя\\nқилишнинг бошқа воситаларидан фойдаланган ҳамда қабул қилинган\\nқарорлардан қаноатланмаган бўлса,</p><p style=\\\"font-size: 16px;font-weight: 700;color: #1a202c\\\"> ўз шикояти бўйича қабул қилинган\\nохирги қарордан хабар топган пайтдан эътиборан бир йил давомида\\nберилган шикоятларни кўриб чиқади.</p>\"}"
